                "title": "Chadio, Bevvy Swift - Age Like Wine Feat. Mr. Archive (Ryan Wells Remix)",
                "description": "Bass Coast Project &amp; East Van Digital present EVD's 7th full length album, the \"Plot Thickens Remix LP\", a companion piece to Chadio's latest EP. This joint project features remixes from already established Bass Coast Project performers such as Taal Mala and Cure, along with EVD alumni Ryan Wells and Woodhead. As a result of the remix competition we held this summer, we are proud to share the winning remix from Like Mind on this release, as well as several runners up, including Beamhead, Gwil, Kline, S2, and Trapezoid.&#13;\n&#13;\nRelease Date:&#13;\nOctober 25th, 2012&#13;\n&#13;\nDirect Purchase Links:&#13;\n&#13;\n<a href=\"http://www.eastvandigital.com/EVDvelop/sample-page/store/chadio-plot-thickens-remix-lp/\" rel=\"nofollow\" target=\"_blank\">Chadio - Plot Thickens Remix LP</a>&#13;\n&#13;\n_<a href=\"http://www.eastvandigital.com/EVDvelop/sample-page/store/chadio-bevvy-swift-age-like-wine-feat-mr-archive-taal-mala-remix/\" rel=\"nofollow\" target=\"_blank\">Chadio, Bevvy Swift - Age Like Wine Feat. Mr. Archive (Taal Mala Remix)</a>&#13;\n_<a href=\"http://www.eastvandigital.com/EVDvelop/sample-page/store/chadio-dj-soo-daylight-feat-crystal-precious-cure-remix/\" rel=\"nofollow\" target=\"_blank\">Chadio, DJ Soo - Daylight Feat. Crystal Precious (Cure Remix)</a>&#13;\n_<a href=\"http://www.eastvandigital.com/EVDvelop/sample-page/store/chadio-joseph-martin-afterturn-kline-remix/\" rel=\"nofollow\" target=\"_blank\">Chadio, Joseph Martin - Afterturn (Kline Remix)</a>&#13;\n_<a href=\"http://www.eastvandigital.com/EVDvelop/sample-page/store/chadio-bevvy-swift-age-like-wine-feat-mr-archive-ryan-wells-remix/\" rel=\"nofollow\" target=\"_blank\">Chadio, Bevvy Swift - Age Like Wine Feat. Mr. Archive (Ryan Wells Remix)</a>&#13;\n_<a href=\"http://www.eastvandigital.com/EVDvelop/sample-page/store/chadio-joseph-martin-afterturn-gwil-remix/\" rel=\"nofollow\" target=\"_blank\">Chadio, Joseph Martin - Afterturn (Gwil Remix)</a>&#13;\n_<a href=\"http://www.eastvandigital.com/EVDvelop/sample-page/store/chadio-dj-soo-daylight-feat-crystal-precious-woodhead-remix/\" rel=\"nofollow\" target=\"_blank\">Chadio, DJ Soo - Daylight Feat. Crystal Precious (Woodhead Remix)</a>&#13;\n_<a href=\"http://www.eastvandigital.com/EVDvelop/sample-page/store/chadio-eradik-nightlife-feat-willisist-trapezoid-beaver-trap-remix/\" rel=\"nofollow\" target=\"_blank\">Chadio, Eradik - Nightlife Feat. Willisist (Trapezoid Beaver Trap Remix)</a>&#13;\n_<a href=\"http://www.eastvandigital.com/EVDvelop/sample-page/store/chadio-bevvy-swift-age-like-wine-feat-mr-archive-s2-get-naked-remix/\" rel=\"nofollow\" target=\"_blank\">Chadio, Bevvy Swift - Age Like Wine Feat. Mr. Archive (S2 Get Naked Remix)</a>&#13;\n_<a href=\"http://www.eastvandigital.com/EVDvelop/sample-page/store/chadio-joseph-martin-afterturn-beamhead-remix/\" rel=\"nofollow\" target=\"_blank\">Chadio, Joseph Martin - Afterturn (Beamhead Remix)</a>&#13;\n_<a href=\"http://www.eastvandigital.com/EVDvelop/sample-page/store/chadio-bevvy-swift-age-like-wine-feat-mr-archive-like-mind-crowfoot-remix/\" rel=\"nofollow\" target=\"_blank\">Chadio, Bevvy Swift - Age Like Wine Feat. Mr. Archive (Like Mind Crowfoot Remix)</a>&#13;\n&#13;\nSupport:&#13;\n&#13;\nBasement Freaks, Mat The Alien, Michael Red, Neighbour, Bevvy Swift, The Librarian, Timothy Wisdom, Yan Zombie, Eradik, Javy Groove, Discosynthetique, Dubconscious, Mr. Geography, Vipond, Autumn Bomb, Briden, City &amp; Mixxxy, Kohsuke Fukuda, Swerve Signal, Jon Lee, Lyssa, PK / King Deluxe &amp; more...&#13;\n&#13;\nFeedback:&#13;\n&#13;\nThe Librarian&#13;\n\"This remix album beautifully captures what's happening in our BC west coast sound at the moment. While each track has a really unique vibe, the Like Mind Crowfoot Remix is on repeat in my player! Excellent Album\" 10/10&#13;\n&#13;\nMat The Alien&#13;\n\"Some really good remixes here\" 10/10&#13;\n&#13;\nMichael Red&#13;\n\"Kline and Beamhead remixes are the ones\"&#13;\n&#13;\nNeighbour&#13;\n\"Taal Mala and S2 bring the original sounding flavour. Enjoying immensely all the mixes but these two stand out.\"&#13;\n&#13;\nBasement Freaks&#13;\n(Cure Remix) \"Some Deep shit right here fellas\"&#13;\n&#13;\nTimothy Wisdom&#13;\n\"Lots of cool tunes on this release. Taal Mala's mix stands out and I love the vocal effect over Crystal Precious on Woodhead's mix. Trapezoid's Trap Remix is also really cool, as well as the S2 and Like Mind mixes.\"&#13;\n&#13;\nJavy Groove&#13;\n(Trapezoid Beaver Trap Remix) \"nice one!!\"&#13;\n&#13;\nLyssa&#13;\n\"Like Mind Crowfoot Remix..really really pretty tune, love the sampling. The Ryan Wells remix is nice and deep, I dig it.\"&#13;\n&#13;\nYan Zombie&#13;\n(Taal Mala Remix) \"great stuff\"&#13;\n&#13;\nKohsuke Fukuda (Galaxy Records, Japan)&#13;\n\"Ryan Wells remix for me. Thanks!\"&#13;\n&#13;\nCity &amp; Mixxxy&#13;\n\"The Cure mix and Ryan Wells mixes were pretty tight...thx guys!\"&#13;\n&#13;\nSwerve Signal&#13;\n\"A good mix of a little bit of everything on this release\"&#13;\n&#13;\nMr. Geography&#13;\n\"Love the Kline remix! Nice array of tunes on here.\"&#13;\n&#13;\nVipond&#13;\n\"Solid and diverse release. I'm all over the Ryan Wells and Gwil remixes myself.\"&#13;\n&#13;\nPK / King Deluxe&#13;\n\"Wow man, great collection of remixes... standouts for me would be S2, Ryan Wells, Taal Mala, Kline, Like Mind and last but not least, whoever the hell this Beamhead is, that one just kills it.\"&#13;\n&#13;\nDubconscious&#13;\n\"Great pack of diverse remixes! My favorites include Cure, Kline, Ryan Wells, S2 &amp; the Crowfoot mixes\"&#13;\n&#13;\nDiscosynthetique&#13;\n(Chadio, Joseph Martin - Afterturn - Gwil Remix) \"FUNKY SICK!!!!!!! Definitely a solid club banger\"&#13;\n&#13;\nBriden&#13;\n\"Really good! S2 Get Naked Remix is sublime.\"&#13;\n&#13;\nAutumn Bomb&#13;\n\"Love the Gwil remix of Afterturn\"&#13;\n&#13;\nLicensing Contact:&#13;\n&#13;\n<a href=\"mailto:info@eastvandigital.com\" rel=\"nofollow\" target=\"_blank\">info@eastvandigital.com</a>",
