                "online": false,
                "description": "Soultanz always maintain a soulful feel, while incorporating hip-hop, RnB, and electronic elements.  The duo out of Seattle is comprised of singer/producer Shayhan Mashayekh and producer Jared Rubens, who often feature local talent.\n\tAt the moment, Soultanz are following up on their 2013 mixtape with their first album, which will be released in 2015.  It will represents a significant departure from their previous releases, as both Jared and Shay are growing as artists and seeking to define their sound.  Each song will have a unique blend of rap, soul, jazz, and funky grooves; The compositions will range from relaxed head-bobbing tracks to all-out dance music.\n\tShayhan began as singer/songwriter who quickly evolved into a talented producer.  As a singer, he has been featured on songs by Sol, BFA, Zetes, and more to come. He counts Bradley Nowell of Sublime, Kaytranada, and Michael McDonald as his influences.\n \tJared Rubens met Shayhan on Soundcloud in 2011 and they have been collaborating ever since.  As a producer, Jared is deeply involved in the composition of the music, spending long hours arranging samples, recording live instruments and helping Shay write lyrics.  He describes as his primary influences J-Swift, Jay Dee, and Latin-American music in general.\n\n\nhttp://www.4shared.com/zip/G9sWgyfo/Soultanz_Mixtape.html",
