                "genre": "Thine",
                "title": "Thine - Out Of Your Mind And Into A Void",
                "description": "THE NEW, THIRD STUDIO ALBUM OF DARK & POIGNANT ROCK/METAL ANTHEMS, ON A 60 MINUTE JOURNEY THROUGH THE RECESSES OF LOSS, ISOLATION & INTROSPECTION.\r\n\r\nHaving formed in 1995 in Yorkshire, UK with the core trio of Alan Gaunt, Paul Groundwell and Daniel Mullins (My Dying Bride), Thine initially burst onto the scene in 1997 with the release of the atmospheric doom Journeys demo tape, with the debut album of boundary-warping metal noir, A Town Like This, appearing on Peaceville the following year. Thines most accomplished work to date, In Therapy saw light of day a full 4 years later, and showcased a more sleek and immediate sound, bringing comparisons to other dark and emotional acts such as Katatonia and Anathema. The band line-up is completed by Dylan Rhodes on rhythm guitar and Richard Swift on bass. \r\n\r\nThe Dead City Blueprint, Thines third studio full-length release, ventures into the deepest recesses of loss, death, and a spiraling disassociation with society in a modern era where we should feel most connected. A journey through the trials of human separation and tribulation. Introspection and retrospection of the most profound order. Mixing the best of rock and elements of prog with sublime structures and hooks, The Dead City Blueprint is a dynamic and poignant musical voyage of despair and catharsis, with soaring lead guitars, somber atmospherics and uplifting vocals.\r\n\r\nThe album was recorded at the legendary Academy Studios (My Dying Bride, Paradise Lost, Anathema) in Dewsbury, West Yorkshire, UK.\r\n\r\nOver the years Thine have shared the stage with acts such as Anathema, My Dying Bride and Katatonia, and plan to tour the UK in February/March 2014 to coincide with the release.\r\n\r\nNew album 'The Dead City Blueprint' coming April 28th.\r\nOrder the album from the Peaceville Store: http://bit.ly/1oYUvNs\r\nMore info http://www.thine-online.co.uk or http://bit.ly/1o3JKfW\r\nwww.peaceville.com",
