                "description": "It has been years since I took the time to write a new profile about myself, I've used the same old one on so many things...now it's time for a change! My name is Brandon Davis, DOB 11/05/1980, from Houston, TX, but currently residing in Tucson, AZ with my wonderful fiance Arista, and our 2 young'uns, Arianabel, 15, and Zen, 8. Some would say out\\r roles in this family are reversed, being as I am the one who does the housework, gets the kids up and ready, cooks, etc...and I home school Ari M-F, too. I am actually looking for some part-time work that will fit with the hours that I am needed at home, but that's a slow process...\r\n\r\nLet's see, hmm...I love animals, sometimes I think I love them, more than I do people...I know that my Diddima Bay is every bit as special to me and as loved by me as the kids! We currently have 1) Diddima (female pit bull, approx. 8-10), Frasty (female fancy rat, name is freakin' and nasty mixed to one word lol), and we are hoping that we will find Jasper (unknown sex, Sonoran Desert King-snake) as he escaped from his enclosure a few days ago :( I had a Chinese water dragon up until a few weeks ago...when I found her up against the cord of her electric heat rock fried to death by electricity! Needless to say, that wasn't a good day.\r\n\r\nI am an extremely proud stepdad of 2 wonderful kids, and they are the main reason I get up and go on everyday! I would love to make some new friends, but finding people I can trust enough to be around the kids has proved to be quite a difficult task here in AZ.\r\n\r\nI'm a musician - it's my main, longest running passion! I can play a few different instruments to a decent degree (bass guitar, drums, piano/keyboard, banjo), and I've played the guitar and harmonica for almost 26 yrs now. My main thing is to sing, though...I may not be the best, but I can promise you that I put my soul into it and that will come across in the delivery every time! I started playing instruments for one reason - to accompany me when I sang...and I had one goal my whole childhood through teens - to be just like Bob Dylan! Well, obviously, I never made it ha ha, but I still love Bob, and I still love the music (I am, I like to say, a walking, talking Bob Dylan songbook and trivia encyclopedia lol).\r\n\r\nI am also a songwriter, and you can hear some of my work om box.com when I decide where would be the best place to post it on here... while your at it, check out my homie's band Woodpecker at http://www.facebook.com/pages/Woodpecker/108910212522646 while you're at it...he's the real deal folks!\r\n\r\nNow for what I like as far as entertainment goes...let's start with Music (my personal fav!) I am just gonna start listing the musicians/bands that have been an inspiration to me either at some time in the past or currently.\r\nBob Dylan - the first music I ever acy\\tually \"listened\" to, and boy! it changed my life!\r\nThe Beatles & John Lennon solo - The Beatles need no explanation, and John is just an amazing human being who was robbed of his life way too soon...because he was \"dangerous\" to those in power\r\nRyan Fagan - regardless of the fact that Fagan and I grew up the closest of friends, I wouldn't have to had known him to appreciate his genius! This guy is a songwriter, and he makes it look easy! He is, by the way, quite nuts\r\nFleet Foxes - this band is just amazing...they are so completely original and in a league all their own\r\nPink Floyd - this band took me almost 10 years to appreciate fully, and now that I do I wonder how & why it took me so long\r\nBeck - this guy is the only musician ever to have come out with upwards of 10 albums with the same number of musical styles and explorations. No one can dance like Beck either! \r\nSublime - I don't need to explain why I love Bradley...everyone loves him!\r\nDeath Cab For Cutie - Ben Gibbard is amazing, and he is such a prolific songwriter...if you dig, then also check out The Postal Service\r\nThe Shins - led my the amazing James Mercer, this band is like a pop tour de force the whole way through...and don't be put off by the word \"pop\" for this is not radio pop, but indie pop...and by the guy who basically started the genre\r\nNow I will simply list a few more favs : 30 Foot Fall, AFI, Alice In Chains, A7X, Bad Religion, Badly Drawn Boy, Bickley, Broken Bells, Counting Crows, Damien Rice, Dashboard Confessional (the acoustic stuff), The Descendents, Dr. Dre, Elton John, The Get Up Kids, Goldfinger, Greenday, Jeff Buckley, Joseph Arthur, Nirvana, NOFX, Oasis, Op Ivy, Pantera, The Ramones, Red Hot Chili Peppers, REM, Silverchair (1st album), Snoop Doggy Dogg, Social D/Mike Ness, STP, Syd Barrett, System of A Down, Taylor Swift (I know, I know....), The Fugees, The Helio Sequence, The Waifs, The Smashing Pumpkins (old), The Wallflowers, 3rd Eye Blind, Tool, Tori Amos, UGK (for life!), Weezer, Woodpecker, Wycleff Jean\r\n",
